import React, { useEffect, useState } from "react";

import SearchView from "../searchView";

import axios from "axios";

const SearchList = () =>{

    const { items } = props

    return(
        <>
            {
                items.length > 0 ?
                <SearchView items = {items}/>
                : ''
            }
            
        </>
    )
}

export default SearchList
